import React from "react";
import FilterSlider from "./FilterSlider";

import "./SideBar.css";

const SideBar = () => {
  /*  
  const timeStepChangeHandler = (e) => {

    }
  */

  return (
    <div className="sidebar-wrapper">
      <div>
        <label>Dataset</label>
        <select>
          <option value="vortex">Vortex</option>
        </select>
      </div>
      <div>
        <form>
          <FilterSlider title="Time Step" min="3" max="90" step="3" />
          <FilterSlider title="Iso Value" min="-0.4" max="0.4" step="0.1" />
          <FilterSlider title="Theta" min="45" max="135" step="15" />
          <FilterSlider title="Phi" min="90" max="270" step="15" />
        </form>
      </div>
    </div>
  );
};

export default SideBar;
